import React from 'react';
import { Box, Typography } from '@material-ui/core';
import { FormikHelpers, Formik, Form,Field } from 'formik';
import { Select } from '@material-ui/core';
import { ModelOTP } from './model';


const OTP = () => {


    return (
        <Box >
            <Box textAlign="left" padding="20px">
                <Typography variant="h4" component="h4" >DayOne</Typography>
            </Box>
            <Box>
                <Typography variant="h4" component="h4" >Let's get started!</Typography>
            </Box>
            <Box>
                <Formik
                    initialValues={{
                        country: '',
                        phone: ''
                    }}
                    onSubmit={(
                        values: ModelOTP,
                        { setSubmitting }: FormikHelpers<ModelOTP>
                    ) => {
                        setTimeout(() => {
                            alert(JSON.stringify(values, null, 2));
                            setSubmitting(false);
                        }, 500);
                    }}
                >
                    {({ submitForm, isSubmitting }) => (
                        <Form>
                            <Field
                                component={Select}
                                name="email"
                                type="email"
                                label="Email"
                            />
                           
                        </Form>
                    )}
                </Formik>
            </Box>

        </Box >
    )
}

export default OTP;
